import axios, { Axios } from "axios";

class User {
    constructor() {
    }

    public async userAll () {
     await   axios.get('http://localhost:3333/user').then((e) => {
            console.log(e.status)
        }).catch((res) => {
            console.log('erreur')
        })
    }
}

export default User;
